import React, { Component } from "react";
import {
  Button,
  Container,
  Form,
  FormGroup,
  Label,
  Input } from 'reactstrap';

import "../App.css"

class SubcribeBox extends Component {
render() {
 return (
   <div className="box">
   <Container>
   <Form>
      <FormGroup>
         <Label for="exampleName" hidden>Nama Lengkap</Label>
         <Input type="text" name="text" id="exampleName" placeholder="Nama Lengkap" />
       </FormGroup>
       <FormGroup>
         <Label for="exampleEmail" hidden>Alamat Email</Label>
         <Input type="email" name="email" id="exampleEmail" placeholder="Alamat Email" />
       </FormGroup>
       <Button
           outline color="warning"
           size="lg"
           block> Subcribe </Button>
   </Form>
   </Container>
   </div>
  )};
};

export default SubcribeBox;
